INSERT INTO `psip_details` (`id`, `psip_name_id`, `psip_date`, `financial_year`, `recurring`, `details`, `created_by`, `created_at`, `updated_at`, `deleted_at`) VALUES
	(1, 5, NULL, '2023', NULL, 'Objectives: To provide high quality targeted agricultural planting material for the farming community and the general public, thereby contributing to the national goal of improved food security while conserving strategic crop germplasm of agricultural importance for the benefit of the present and future generations.', NULL, NULL, '2023-11-29 19:16:12', '2023-11-29 19:16:12'),
	(2, 6, NULL, '2023', NULL, 'Objectives: To increase the efficiency and effectiveness with which production targets are achieved at the La Reunion Plant Propagation Station while ensuring that a high quality of goods and services are offered to the clients.	\r\n', NULL, NULL, '2024-02-15 15:28:24', '2024-02-15 15:28:24'),
	(3, 7, NULL, '2023', NULL, 'Objectives: To contribute to the enhancement of both food security and food safety, through the provision of infrastructure and facilities that meet both local and/or international standards, in accordance with the practice of responsible fisheries.	\r\n', NULL, NULL, NULL, NULL),
	(4, 8, NULL, '2023', NULL, 'Objectives: To  reforest denuded areas of land within the Northern Range in order to maintain this critical watershed and create vegetative cover that will reduce the impact of erosion and promote a greener and healthier Trinidad	\r\n', NULL, NULL, NULL, NULL),
	(5, 9, NULL, '2023', NULL, 'Objective: To increase forest capital by addressing various issues leading to reduced forest cover.	\r\n', NULL, NULL, NULL, NULL),
	(6, 10, NULL, '2023', NULL, 'Objectives: Increase the Forestry Division\'s forest fire fighting capabilities whilst developing best safety practices and using strong scientific data to chart future approaches	\r\n', NULL, NULL, NULL, NULL),
	(7, 11, NULL, '2023', NULL, 'Objectives: To improve the management of the Natural Forest through improved techniques, internationally accepted Strategies and specific interventions	\r\n', NULL, NULL, NULL, NULL),
	(8, 12, NULL, '2023', NULL, 'Objective: To initiate a wetland conservation programme that combats habitat destruction poaching of wildlife and pollution by increasing security, improving infrastructure and promoting environmental awareness 	\r\n', NULL, NULL, NULL, NULL),
	(9, 13, NULL, '2023', NULL, 'Objective: To provide road access to the State\'s forest, wildlife and national park resources.	\r\n', NULL, NULL, NULL, NULL),
	(10, 14, NULL, '2023', NULL, 'Objective: To develop the country\'s national parks, natural heritage sites and reserves.	\r\n', NULL, NULL, NULL, NULL),
	(11, 15, NULL, '2023', NULL, 'Objective: To sustainably manage the wildlife resources of TT.	\r\n', NULL, NULL, NULL, NULL),
	(12, 17, NULL, '2023', NULL, 'Objective : to add value to the livestock sub-sector, by improving SFC’s ability to provide Research, Training and Demonstration to the stakeholders in the livestock sub- sector in alignment and cmpliance with Codex  Alimentarius international standards	\r\n', NULL, NULL, NULL, NULL),
	(13, 18, NULL, '2023', NULL, 'Objective: To expand the Sanitary and Phytosanitary Measures and Food Safety Capabilities for the protection of Trinidad and Tobago’s Agro-ecological Environment	\r\n	\r\n', NULL, NULL, NULL, NULL),
	(14, 19, NULL, '2023', NULL, 'Objective To provide facilities for maximization of germplasm conservation and production of high quality planting material at Marper Farm', NULL, NULL, NULL, NULL),
	(15, 20, NULL, '2023', NULL, ' Objectives: To upgrade the infrastructure, provide a security presence, replace outdated seed processing equipment, ensure an adequate supply of irrigation water and train staff so as to facilitate the production of high quality seeds and planting materials in sufficient quantities to meet production targets as outlined in the Ministry of Agriculture Land and Fisheries policy document.	\r\n', NULL, NULL, NULL, NULL),
	(16, 21, NULL, '2023', NULL, 'Objectives: To develop sustainable coconut based enterprises with emphasis on tender coconut water production in the East Coast Trinidad, through rehabilitation and replanting of 900 acres of land cultivated with coconut	', NULL, NULL, NULL, NULL),
	(17, 22, NULL, '2023', NULL, 'Objective: The objective of this Project is to enhance the efficiency and effectiveness of the delivery of services provided by the Fisheries Division by strengthening the Information Communication and Technology capacity of the Fisheries Division by improving the capture, storage, search and retrieval and security of documents and data.	\r\n', NULL, NULL, NULL, NULL),
	(18, 23, NULL, '2023', NULL, 'Objective : To achieve food and nutrition security by reducing the impact of locust behaviour on the local Agricultural Sector.	\r\n', NULL, NULL, NULL, NULL),
	(19, 24, NULL, '2023', NULL, 'Objective: To provide an expanded and upgraded wholesale facility for fresh produce grown in Trinidad and Tobago	\r\n', NULL, NULL, NULL, NULL),
	(20, 25, NULL, '2023', NULL, 'Objective: To focus on improving farm productivity, food security, and nutrition and advance income opportunities for women, youths and agri-entrepreneurs especially in rural communities. 	\r\n', NULL, NULL, NULL, NULL),
	(21, 26, NULL, '2023', NULL, 'Objective: To provide reasonable access to farmers along 240 km of roads that facilitates agriculture production of targeted commodities and strategic crops.	\r\n', NULL, NULL, NULL, NULL),
	(22, 27, NULL, '2023', NULL, 'Objective: To provide suitable office accommodation and other facilities for the North Region of the Ministry of Agriculture, Land and Fisheries and ii. Increase the capacity of staff to deliver quality extension services to clients in rural communities of the Regional Administration North Division 	\r\n', NULL, NULL, NULL, NULL),
	(23, 28, NULL, '2023', NULL, 'Objective: To organise cocoa farmers, their resources and production base into clusters made up of a lead farm and surrounding satellite farms. The clusters will improve  education, training, infrastructure, product quality development, access to organised labour pools, improved planting material, certification, branding, farmers’ field schools, linkages to value add and other support services for streamlining of their cocoa business base towards improved productivity, quality, value add and profitability. 	\r\n', NULL, NULL, NULL, NULL),
	(24, 29, NULL, '2023', NULL, 'Objective: To train, guide and support local farmers with respect to adherence to Good Agricultural Practices (GAPs) and other globally recognized regulations	\r\n', NULL, NULL, NULL, NULL),
	(25, 30, NULL, '2023', NULL, 'Objectives: To employ the methodology developed using Satellite Imagery, UAVs, and geospatial analytical techniques to estimate crop production for all agricultural areas across Trinidad and Tobago, Implement the National Agriculture Mapping and Monitoring System (NAMMS) developed in Phase I within the Corporation and Develop appropriate institutional capacity procedures, work processes, standards, and documentation to support sustainable implementation of the NAMMS.   	\r\n', NULL, NULL, NULL, NULL),
	(26, 31, NULL, '2023', NULL, 'Objective: To achieve food and nutrition security and To increase production of identified strategic commodities	', NULL, NULL, NULL, NULL),
	(27, 32, NULL, '2023', NULL, 'Objective: To provide and make available water for sustainable farming in the dry season.	', NULL, NULL, NULL, NULL),
	(28, 33, NULL, '2023', NULL, 'Objective: To enable sustainable farming in the Plum Mitan Project throughout the year (Phase II).	\r\n', NULL, NULL, NULL, NULL),
	(29, 34, NULL, '2023', NULL, 'Objective: To develop the Botanic Gardens into a world class facility geared towards expanding plant biodiversity through increased diverse plant collections, facilitated by the construction of an efficient and sustainable water distribution system and other support facilities.  	\r\n', NULL, NULL, NULL, NULL),
	(30, 35, NULL, '2023', NULL, 'Objective:To raise public awareness of existing wetlands in a specific areas and to provide fundamental knowledge to local and foreign visitors while accommodating schools, training, meeting place and workshops.	\r\n', NULL, NULL, NULL, NULL),
	(31, 36, NULL, '2023', NULL, 'Objective: The creation of functional Archival library of Survey plans, photographs and maps of Trinidad and Tobago.', NULL, NULL, NULL, NULL),
	(32, 37, NULL, '2023', NULL, 'Objective: To re-equip the Hydrographic unit with up to date Hydrographic surveying equipment in order to provide that the public and private sector with current bathymetric surveys and hydrodynamic processes	\r\n', NULL, NULL, NULL, NULL),
	(33, 38, NULL, '2024', NULL, 'A concise description of the PSIP is displayed here.', NULL, NULL, '2024-12-09 14:17:11', NULL),
	(34, 39, NULL, '2023', NULL, 'Objective: The objective of this project is to Develop an Online Platform for ease of access and Data Collection to assist all the Divisions. 	\r\n', NULL, NULL, NULL, NULL),
	(35, 40, NULL, '2023', NULL, 'Objective: To allow for the award of a contract for consultancy services and technical assistance to facilitate the data entry of approximately 120,000 survey plans into the Cadastral Database.  	\r\n', NULL, NULL, NULL, NULL),
	(37, 42, NULL, '2023', NULL, 'Objectives: To strengthening the Fisheries Division to enhance national arrangements for implementation (including monitoring, control and surveillance) and enforcement of relevant fisheries laws and management measures. These arrangements will conform to international law and agreements and act as enablers for the penetration of international markets.	', NULL, NULL, NULL, NULL),
	(38, 43, NULL, '2023', NULL, 'Objectives: to manage essential programmes of the Ministry with the ability to monitor each client and track all FRP renewals, crops cultivated, agricultural incentives applied and paid for, as well as all flooding natural disaster assistance processed.	', NULL, NULL, '2024-11-26 13:00:32', '2024-11-26 13:00:32'),
	(39, 44, NULL, '2023', NULL, 'Objective :  To facilitate training of staff and farmers in new and emerging technologies, to achieve food nutrition and food security.	', NULL, NULL, NULL, NULL),
	(40, 45, NULL, '2023', NULL, 'Objective:  To provide the human resource that is equipped  with the competency in field of occupational safety, and  health awareness in accordance to the OSH Act.', NULL, NULL, NULL, NULL),
	(41, 46, NULL, '2023', NULL, 'Objectives: To completely refurbish the infrastructural facilities at the Central Experiment Station and to outfit offices and laboratories with furnishings required to conduct accurate research and provide expedient and professional services to the farming community and the general public.', NULL, NULL, NULL, NULL),
	(42, 47, NULL, '2023', NULL, 'Objective: To develop, improve and expand the office buildings and related property of the Ministry in order to achieve efficiency and effectiveness  in the conduct of agriculture and other government work', NULL, NULL, NULL, NULL),
	(43, 48, NULL, '2023', NULL, 'Objective: To reduce Praedial Larceny in the various farming communities by continued vigilance through 24hr mobile patrols.', NULL, NULL, NULL, NULL),
	(44, 49, NULL, '2023', NULL, 'Objectives: To undertake aerial and LIDAR survey, to extractdigital large scale map data ( vector mapping) from the aerial photography and LIDAR data captured,To gain experience and knowledge in the execution of a national mapping exercise and to update knowledge base,To provide the geographically referenced map base for the preparation of the Parcel Index map required under the Land Adjudication Act and other geospatial activities required by stakeholders', NULL, NULL, NULL, NULL),
	(45, 16, NULL, '2023', NULL, 'Objective: To secure crop genetic resources for future use, to contribute to national food self-sufficiency in local agricultural crop production through a comprehensive crop biodiversity conservation strategy in the event of natural disasters and impending effects of climate change	\r\n', NULL, NULL, NULL, NULL),
	(46, 50, NULL, '2023', NULL, 'Objective: To contribute to the enhancement of both food security and food safety, through the provision of infrastructure and facilities that meet both local and/or international standards, in accordance with the practice of responsible fisheries.  	\r\n', NULL, NULL, NULL, NULL),
	(47, 51, NULL, '2023', NULL, 'Objectives: A major commitment of the GORTT to former employees of Caroni (1975) Ltd involved the offer of a residential service lot to eligible persons.  The discharge of this commitment involved the establishment of 29 residential estates which required not only infrastructural development; but also approvals from statutory agencies including the EMA, WASA, T&TEC, Town and Country Planning Division, Drainage Division and the Regional Corporations.	\r\n', NULL, NULL, NULL, NULL),
	(48, 52, NULL, '2023', NULL, 'Objective; To improve the aging physical infrastructure with enclosures that are naturalistic and  provide a conservation and education facility to meet the Association of Zoos and Aquariums (AZA) standards. 	\r\n', NULL, NULL, NULL, NULL),
	(53, 5, NULL, '2024', NULL, 'Objectives: To provide high quality targeted agricultural planting material for the farming community and the general public, thereby contributing to the national goal of improved food security while conserving strategic crop germplasm of agricultural importance for the benefit of the present and future generations.', NULL, '2023-11-29 19:16:12', '2023-11-29 19:16:12', NULL),
	(54, 6, NULL, '2024', NULL, 'Objectives: To increase the efficiency and effectiveness with which production targets are achieved at the La Reunion Plant Propagation Station while ensuring that a high quality of goods and services are offered to the clients.', NULL, '2024-02-15 15:28:24', '2024-02-15 15:28:24', NULL),
	(59, 43, NULL, '2024', NULL, 'Objectives: to manage essential programmes of the Ministry with the ability to monitor each client and track all FRP renewals, crops cultivated, agricultural incentives applied and paid for, as well as all flooding natural disaster assistance processed.', NULL, '2024-11-26 13:00:32', '2024-11-26 13:00:32', NULL),
